    false,nt"url": null,nt"notes": "In the spring of 1984 the Alaska Department
    of Fish and Game (ADF&G) entered into a cooperative agreement with the U.S. Fish
    and Wildlife Service (USF&WS) to conduct studies on sport fishing activities in
    the Togiak National Wildlife Refuge. These data are needed to determine current
    use patterns on the Refuge and to aid in preparation of a comprehensive Refuge Management
    Plan. Results of the study are summarized in this report.",nt"license_title":
